style.css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

a.new_post_label > i {
  height: 90px;
}
.new_post > .post_avatar:after { /* nipple */
  border-right-color: rgb(3,12,77) !important;
  }

.new_post { /* background */
  background: url('data:image/gif;base64,') top center rgb(3,12,77) !important;
  }

.new_post_label { /** hide the label text **/
  font-size: 0 !important;
  }

.new_post_label > I:before { /** hide the default icons **/
  content: none !important;
  }

.new_post_label > I { /* post icons */
  background: url('http://i41.tinypic.com/2rgj13q.png') no-repeat !important;
  background-size: auto !important;
  z-index: -1;
  transition-property: background-position !important;
}

.new_post_label:nth-child(1) > I {background-position: 2px 0px !important}
.new_post_label:nth-child(2) > I {background-position: -73px 0px !important}
.new_post_label:nth-child(3) > I {background-position: -148px 0px !important}
.new_post_label:nth-child(4) > I {background-position: -223px 0px  !important}
.new_post_label:nth-child(5) > I {background-position: -298px 0px !important}
.new_post_label:nth-child(6) > I {background-position: -373px 0px  !important}
.new_post_label:nth-child(7) > I {background-position: -448px 0px !important}

.new_post_label:nth-child(1):hover > I {background-position: 2px -4px !important}
.new_post_label:nth-child(2):hover > I {background-position: -73px -4px !important}
.new_post_label:nth-child(3):hover > I {background-position: -148px -4px !important}
.new_post_label:nth-child(4):hover > I {background-position: -223px -4px  !important}
.new_post_label:nth-child(5):hover > I {background-position: -298px -4px !important}
.new_post_label:nth-child(6):hover > I {background-position: -373px -4px  !important}
.new_post_label:nth-child(7):hover > I {background-position: -448px -4px  !important}

.new_post_label:nth-child(1):active > I {background-position: 2px 0px !important}
.new_post_label:nth-child(2):active > I {background-position: -73px 0px !important}
.new_post_label:nth-child(3):active > I {background-position: -148px 0px !important}
.new_post_label:nth-child(4):active > I {background-position: -223px 0px !important}
.new_post_label:nth-child(5):active > I {background-position: -298px 0px !important}
.new_post_label:nth-child(6):active > I {background-position: -373px 0px !important}
.new_post_label:nth-child(7):active > I {background-position: -448px 0px !important}

}
